import React from "react";
import ReactDOM from "react-dom";
import App from "./App.js";
import "./index.css";
import { BookContextProvider } from "./store/book-context";

ReactDOM.render(
  <BookContextProvider>
    <App />
  </BookContextProvider>,
  document.getElementById("root")
);
